def maximize_grade(n: int, t: int, grade: str) -> str:
    s = list(grade)
    ind = n
    perenos = 1
    for i in range(n):
        if s[i] == '.':
            nach = i + 1
            break
    for i in range(nach, n):
        if int(s[i]) > 4:
            ind = i
            break
    if ind == n:
        return ''.join(s)
    while t > 0 and s[ind] != '.':
        if int(s[ind]) > 3:
            ind -= 1
            perenos = 1
            t -= 1
            if s[ind] == '9':
                t += 1
        else:
            s[ind] = str(int(s[ind]) + 1)
            perenos = 0
            break
    if s[ind] == '.':
        ind -= 1
        while s[ind] == '9':
            s[ind] = '0'
            ind -= 1
        if ind < 0 and perenos != 0:
            return '1' + ''.join(s)
        else:
            s[ind] = str(int(s[ind]) + perenos)
            return ''.join(s[:s.index('.')])
    else:
        while s[ind] == '9' or s[ind] == '.':
            if s[ind] == '.':
                ind -= 1
                continue
            s[ind] = '0'
            ind -= 1
        s[ind] = str(int(s[ind]) + perenos)
        return ''.join(s[:ind + 1])

